import React from "react";

const LandPadItem = (props) => {
  return (
    // <div style={{ marginTop: "30px",maxHeight:"500px",height: "400px"}}>
    <div
      className="card bg-dark text-light my-3 "
      style={{ width: "390px", height: "500px" }}
    >
      <img
        src={props.images}
        className="card-img-top img-fluid"
        alt="..."
        style={{ height: "250px" }}
      />
      <div className="card-body">
        <h5 className="card-title">{props.name}</h5>
        <p>full_Name: {props.full_name}</p>
        <p className="card-text text-start">{props.details.slice(0, 150)}...</p>
        <a href="#" className="btn btn-primary">
          Go somewhere
        </a>
      </div>
    </div>
  );
};
export default LandPadItem;
